import SignIn from './Sign-In';
import Doctor from './components/doctorDashboard';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom'
import Profile from './pages/profile'
import Patients from './pages/patients'
import Meetings from './pages/meetings';
import Appointments from './pages/appointments';
import Admin from './components/adminDashboard';
import AdminDoctors from './adminpages/doctors';
import AdminPatients from './adminpages/patients';
import Administrator from './adminpages/admin';
import DoctorDashboard from './components/doctorDashboard';
import VideoCall from './pages/VideoCall';

function App() {

  return(
 <div style={{backgroundColor:'#05325f'}}> 
    <Router>
      {/* <SignIn/> */}
      <Routes>
        <Route exact path="/" element={ <SignIn/> }/>
         {/* <Route path='/home' element={<Doctor/>}/> */}

         {/* <Route path='/profile'  element={<Profile/>}/> */}
         <Route path='/profile/:name/:password/:designation/:gender/:address/:highest_qualification' element={<Profile/>}/>
         <Route path='/patients' element={<Patients/>}/>
         <Route path='/meetings' element={<Meetings/>}/>
         <Route path='/appointments' element={<Appointments/>}/>
         <Route path='/video_call/:video_id' element={<VideoCall/>}/>



         {/* <Route exact path="/admin" element={ <Admin/> }/> */}

         <Route path='/doctors_list' element={<AdminDoctors/>}/>
         <Route path='/patients_list' element={<AdminPatients/>}/>
         <Route path='/admindetails' element={<Administrator/>}/>
      </Routes>
    </Router>
    </div>
  )
}


export default App;
